DROP TABLE IF EXISTS osadl;
CREATE TABLE osadl
(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    license_id TEXT UNIQUE NOT NULL,
    compatibilities TEXT DEFAULT '[]',
    incompatibilities TEXT DEFAULT '[]',
    copyleft_clause BOOLEAN,
    patent_hints BOOLEAN,
    depending_compatibilities TEXT DEFAULT '[]',
    use_cases TEXT DEFAULT '[]'
);

